import siteLogo from './FutureBrightLogo.svg';
import settingsImg from './gear.svg';
import notificationsImg from './bell.svg';
import profileImg from './profile.svg';
import './Header.css';

const Header = () => {
  return (
    <div className="topnav">
      <img src={siteLogo} className="Future-Bright-Logo" alt="logo" />
      <input></input>
      <img src={settingsImg} className="settings"></img>
      <img src={notificationsImg} className="notifications"></img>
      <img src={profileImg} className="profile"></img>
    </div>
  );
}

export default Header;
